import React from 'react';
import classes from './InputTimer.module.css';

const InputTimer = ({runTimer,stopTimer,status}) => {
  return (
  <>
  {!status.play?
  <div className={classes.btn}>
    <input type="button" onClick={runTimer} className={classes.btn_play}/> 
  </div>
  :
  <div className={classes.btn}>
    <input type="button" onClick={stopTimer} className={classes.btn_stop}/> 
  </div>} 
  </>
  )};

export default InputTimer;
